import React from 'react';
import { Tabs } from 'antd';
import { HomeOutlined, DashboardOutlined, FormOutlined, UserOutlined } from '@ant-design/icons';
import '../../Styles/PrincipalAdmin.css';
import RegistroSiniestroForm from '../Ajuster/RegistrarSiniestro';
import { useNavigate } from 'react-router-dom';

const { TabPane } = Tabs;

const PrincipalAdmin = () => {

  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/Login');
  };

  return (
    <div className="app-container">
      <div className="content">
        <Tabs
          defaultActiveKey="1"
          tabPosition="bottom"
          size="large"
          animated
          className="custom-tabs"
        >
          <TabPane
            tab={
              <span>
                <HomeOutlined />
              </span>
            }
            key="1"
          >
            <h2>Contenido de Home</h2>
          </TabPane>
          <TabPane
            tab={
              <span>
                <FormOutlined />
              </span>
            }
            key="2"
          >
            <h2>Registro de siniestros</h2>
            <RegistroSiniestroForm/>
            <br></br>
            <br></br>
            <br></br>
            <br></br>

          </TabPane>
          <TabPane
            tab={
              <span>
                <DashboardOutlined />
              </span>
            }
            key="3"
          >
            <h2>Contenido de Likes</h2>
          </TabPane>
          <TabPane
            tab={
              <span>
                <UserOutlined />
              </span>
            }
            key="5"
          >
            <h2>Contenido de Profile</h2>
          </TabPane>
        </Tabs>
      </div>
    </div>
  );
};

export default PrincipalAdmin;
